apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://8B3B1C96789EC45288529860A76D2468.gr7.eu-central-1.eks.amazonaws.com
  name: my-cluster.eu-central-1.eksctl.io
contexts:
- context:
    cluster: my-cluster.eu-central-1.eksctl.io
    user: admin@my-cluster.eu-central-1.eksctl.io
  name: admin@my-cluster.eu-central-1.eksctl.io
current-context: admin@my-cluster.eu-central-1.eksctl.io
kind: Config
preferences: {}
users:
- name: admin@my-cluster.eu-central-1.eksctl.io
